11.body:
async/.await는 동기 코드처럼 보이는 비동기 함수를 작성하기 위한 Rust의 빌트인 도구입니다. async는 코드 블록을 Future라는 트레잇을 구현하는 상태 머신으로 변환합니다. 동기 메서드에서 차단된 함수를 호출하면 전체 스레드가 차단되지만 차단된 Future는 스레드를 제어하여 다른 Future를 실행시킵니다. Cargo.toml 파일에 종속성을 추가해봅시다. [dependencies]
futures = "0.3" 비동기 함수를 만들기 위해 async fn 함수를 사용할 수 있습니다. async fn do_something() { /* ... */ } async fn에서 반환하는 값은 Future 타입입니다. 어떤 일이 일어나려면 누군가가 Future를 실행해야 합니다. // `block_on`은 필요한 future가 완료될 때까지 현재 스레드를 중단시킵니다.
// 다른 실행자(executor)들은 여러 future들을 같은 스레드에서 실행하는 // 일정을 짜는 등 더 복잡한 방식을 제공합니다.
use futures::executor::block_on; async fn hello_world() { println!("hello, world!");
} fn main() { let future = hello_world(); // 아무것도 출력하지 않습니다. block_on(future); // `future`가 실행되어서 "hello, world!"를 출력합니다.
} async fn 블록 내부에서는 .await을 사용해서 다른 async fn의 결과같이 Future 트레잇을 구현한 다른 타입이 완료되기를 기다릴 수 있습니다. block_on과 달리 .await는 현재 스레드를 차단하지 않습니다. 대신 future가 지금 실행될 수 없다면 future가 완료될 때까지 비동기적으로 기다리면서 다른 작업을 실행합니다. 예를 들어 learn_song, sing_song, dance라는 3개의 async fn이 있다고 생각해봅시다. async fn learn_song() -> Song { /* ... */ }
async fn sing_song(song: Song) { /* ... */ }
async fn dance() { /* ... */ } 노래를 배우고, 노래를 부르고, 춤을 추는 방법 중에는 각각을 실행하는 동안 다른 행동을 차단하는 방법도 있습니다. fn main() { let song = block_on(learn_song()); block_on(sing_song(song)); block_on(dance());
} 하지만 우리는 이런 식으로 가능한 최고의 성능을 뽑을 수 없습니다. 한 번에 하나씩만 하고 있으니까요. 간단히 말해서 노래하기 전에 노래를 배우긴 해야겠지만 노래하면서 동시에 춤을 출 수도 있습니다. 이렇게 하려면 동시에 실행할 수 있는 두 개의 async fn을 만들어야 합니다. async fn learn_and_sing() { // 노래를 배울 때까지 기다립니다. // `block_on` 대신 `.awiat`을 사용해서 스레드를 멈추게 하는 것을 막습니다. // 그래서 `dance`를 동시에 실행할 수 있습니다. let song = learn_song().await; sing_song(song).await;
} async fn async_main() { let f1 = learn_and_sing(); let f2 = dance(); // `join!`은 `.await`와 비슷하지만 여러 개의 future를 동시에 기다릴 수 있습니다. // `learn_and_sing` future에 막혀 있다면 `dance` future가 현재의 스레드를 접수할 것입니다. // `dance`가 막혀 있다면 `learn_and_sing`이 다시 스레드를 접수하겠죠. // 두 future가 모두 막혀있으면 `async_main`이 막히고 실행자에게 권한이 갈 것입니다. futures::join!(f1, f2);
} fn main() { block_on(async_main());
} 여기서 노래를 부르기 전에 노래를 배워야 하지만 노래를 배우고 부르는 것 모두 춤을 추면서 할 수 있습니다. learn_and_sing의 learn_song().await 대신 block_on(learn_song())을 사용하면 learn_song이 실행되는 동안 스레드가 다른 작업을 할 수 없습니다. 그러면 동시에 춤을 추는 것이 불가능한 거죠. .await으로 learn_song future를 기다리게 하면 learn_song이 블락되었을 때 다른 작업이 현재의 스레드를 사용하게 할 수 있습니다. 이를 통해 동일한 스레드에서 완료해야 하는 여러 future를 동시에 실행할 수 있습니다.

13.body:
Future 트레잇은 Rust 비동기 프로그래밍의 중심에 있습니다. Future는 (()와 같이 빈 값일 수도 있지만) 값을 생성할 수 있는 비동기 연산입니다. 단순화된 버전의 future 트레잇은 아래와 같을 것입니다. trait SimpleFuture { type Output; fn poll(&mut self, wake: fn()) -> Poll<Self::Output>;
} enum Poll<T> { Ready(T), Pending,
} poll 함수를 호출해서 future를 다음 단계로 보낼 수 있는데 이는 future를 최대한 완료되도록 이끄는 역할을 합니다.(역자 주: "완료를 향해 이끈다"는 표현이 이해가 되지 않을 수 있습니다. 다음 문장에 나오지만, poll 메서드를 실행해도 결과가 나오지 않고 Ready(result) 혹은 Pending이라는, 가능한 두 상태를 담은 enum을 반환할 뿐입니다.) future가 완료되면 Poll::Ready(result)를 반환합니다. future가 아직 완료되지 않았으면 Poll::Pending을 반환한 후 Future가 다음 단계로 넘어갈 준비가 되었을 때 wake() 함수를 호출하도록 해놓습니다. wake()가 호출되면 실행자가 Future로 하여금 poll을 다시 호출하여 Future를 다음 단계로 넘어가도록 만듭니다. wake()가 없었으면 실행자는 특정 future가 언제 다음 단계로 넘어갈 준비가 되는지 알 수가 없기 때문에 지속적으로 모든 future에서 폴링을 해야 합니다. wake()를 사용하면 실행자가 정확하게 어느 future가 poll을 실행할 준비가 되었는지 알 수가 있죠. 예를 들어 이미 사용한 데이터가 있거나 없을 수 있는 소켓에서 무언가를 읽고자 하는 경우를 생각해봅시다. 데이터가 있으면 읽어서 Poll::Ready(data)를 반환할 것이고 데이터가 준비되어 있지 않으면 future가 중단된 상태로 아무런 변화가 없을 것입니다. 아무 데이터도 사용할 수 없는 상태이면 데이터가 소켓에 준비되었을 때 호출할 wake를 등록해둬야 합니다. 간단한 SocketRead future는 아래와 같이 나오겠죠. pub struct SocketRead<'a> { socket: &'a Socket,
} impl SimpleFuture for SocketRead<'_> { type Output = Vec<u8>; fn poll(&mut self, wake: fn()) -> Poll<Self::Output> { if self.socket.has_data_to_read() { // 소켓에 데이터가 있을 경우, 읽어서 버퍼에 넣은 후 반환 Poll::Ready(self.socket.read_buf()) } else { // 소켓에 데이터가 없는 경우, // // 데이터가 사용가능할 때 `wake`를 호출하도록 설정 // 데이터가 사용가능할 때 `wake`가 호출되고 // 그 결과 이 `Future`의 사용자가 인지해서 `poll`을 실행해서 // 데이터를 받음 self.socket.set_readable_callback(wake); Poll::Pending } }
} 이 Future 모델을 사용하면 중간 할당 없이도 여러 비동기 작업들을 함께 조합할 수 있습니다. 한 번에 여러 future들을 실행하거나 연결하는 것을 할당이 없는 상태 머신을 통해서도 다음과 같이 구현할 수 있죠. /// 두 개의 future가 모두 완료될 때까지 동시적으로 실행하는 SimpleFuture
///
/// 동시성은 각 future의 `poll` 호출이 독립적으로 이뤄질 수 있다는 것을 통해 달성됩니다.
/// 이를 통해 각 future는 각자의 속도로 다음 단계로 갈 수 있습니다.
pub struct Join<FutureA, FutureB> { // 각 필드는 완료될 때까지 작동하는 future를 담고 있을 수 있습니다. // future가 이미 완료되었으면 그 필드는 `None`이 됩니다. // 이를 통해 완료된 뒤에도 계속 폴링을 하는 것을 막습니다. // `Future` 트레잇의 내용과 어긋나니까요. a: Option<FutureA>, b: Option<FutureB>,
} impl<FutureA, FutureB> SimpleFuture for Join<FutureA, FutureB>
where FutureA: SimpleFuture<Output = ()>, FutureB: SimpleFuture<Output = ()>,
{ type Output = (); fn poll(&mut self, wake: fn()) -> Poll<Self::Output> { // future `a`를 완료하려고 합니다. if let Some(a) = &mut self.a { if let Poll::Ready(()) = a.poll(wake) { self.a.take(); } } // future `b`를 완료하려고 합니다. if let Some(b) = &mut self.b { if let Poll::Ready(()) = b.poll(wake) { self.b.take(); } } if self.a.is_none() && self.b.is_none() { // 두 future가 모두 완료되어서 성공적으로 반환할 수 있습니다. Poll::Ready(()) } else { // 하나 혹은 두 future 모두가 `Poll::Pending`을 반환하면 아직 덜 끝났다는 뜻입니다. // 그러면 변화가 있을 때 `wake()`를 호출할 것입니다. Poll::Pending } }
} 이렇게 되면 별도의 할당없이도 여러 future들을 동시에 실행하여 보다 효율적인 비동기 프로그램이 가능합니다. 마찬가지로 다음과 같이 여러 future들을 순차적으로 실행할 수도 있습니다. /// 두 개의 future가 모두 완료될 때까지 하나씩 실행하는 SimpleFuture
//
// Note: 간단한 예시를 위해 `AndThenFut`은 두 future가 모두 생성될 때 사용가능하다고 가정합니다.
// 실제 `AndThen` 결합자는 `get_breakfast.and_then(|food| eat(food))`와 같이
// 첫번째 future의 결과값을 바탕으로 두번째 future를 생성할 수 있습니다.
pub struct AndThenFut<FutureA, FutureB> { first: Option<FutureA>, second: FutureB,
} impl<FutureA, FutureB> SimpleFuture for AndThenFut<FutureA, FutureB>
where FutureA: SimpleFuture<Output = ()>, FutureB: SimpleFuture<Output = ()>,
{ type Output = (); fn poll(&mut self, wake: fn()) -> Poll<Self::Output> { if let Some(first) = &mut self.first { match first.poll(wake) { // 첫번째 future를 완료한 경우입니다. // 삭제하고 두 번째를 시작합시다. Poll::Ready(()) => self.first.take(), // 아직 첫번째 future를 완료하지 못한 경우입니다. Poll::Pending => return Poll::Pending, }; } // 이제 첫번째 future는 끝났으니 두번째를 완료할 차례입니다. self.second.poll(wake) }
} 이 예제는 Future 트레잇을 사용하여 여러 개의 할당된 객체와 깊이 중첩된 콜백없이도 비동기 제어 흐름을 표현하는 방법을 보여줍니다. 이제 실제의 Future 트레잇을 보며 앞의 예제(역자주: SimpleFuture 트레잇)와의 차이점에 대해서 이야기해보겠습니다. trait Future { type Output; fn poll( // `&mut self`가 아니라 `Pin<&mut Self>`입니다. self: Pin<&mut Self>, // `wake: fn()`가 아니라 `cx: &mut Context<'_>`입니다.: cx: &mut Context<'_>, ) -> Poll<Self::Output>;
} 첫번째 변경사항은 self 타입이 더 이상 &mut Self가 아니라 Pin<&mut Self>로 변경되었다는 것입니다. 피닝(pinning)에 대해서는 다음 장 에서 더 자세하게 다룰 것이라서 지금은 피닝이 옮길 수 없는(move가 안 되는) future를 만들 수 있게 한다는 것 정도만 알고 있으면 됩니다. struct MyFut { a: i32, ptr_to_a: *const i32 }처럼 옮길 수 없는 객체는 필드에 포인터를 저장할 수 있습니다. async/await를 활성화하려면 피닝이 필요합니다. 두번째는 wake: fn()이 &mut Context<'_>로 변경되었습니다. 예제에서 다룬 SimpleFuture에서는 future 실행자에게 문제의 future에서 폴링해야 한다고 알리기 위해서 함수 포인터(fn())를 호출했습니다. 그러나 fn()은 함수 포인터일 뿐이라서 어느 Future가 wake를 호출하는지에 대한 아무런 데이터도 저장할 수 없는 문제가 있습니다. 실제 시나리오에서 웹서버와 같은 복잡한 응용프로그램에는 '깨우기' 기능을 개별적으로 관리해야 하는 수천 개의 연결이 있을 수도 있습니다. 실제 Future트레잇에서 쓰는 Context 타입은 특정 작업을 깨우는데 사용할 수 있는 Waker 타입의 값을 저장해서 이 문제를 해결합니다.(역자주: Context타입에 Waker타입으로 어느 Future가 wake를 호출했는지 저장해둔다는 의미)

