예시를 만들어 봅시다. 타이머가 생성될 때 새 스레드를 만들고 수면 시간 동안은 자고 시간이 되면 타이머 future가 신호를 주는 걸로 하겠습니다. 시작하기 위해 필요한 라이브러리들은 다음과 같습니다. use std::{ future::Future, pin::Pin, sync::{Arc, Mutex}, task::{Context, Poll, Waker}, thread, time::Duration,
}; future 타입 자체를 정의하는 것부터 시작하겠습니다. 이 future에는 스레드에게 타이머가 종료되고 future가 완료될 것이라는 것을 알릴 방법이 필요합니다. 그래서 스레드와 future 사이의 통신을 위해 Arc<Mutex<..>> 값을 공유해서 사용할 것입니다. pub struct TimerFuture { shared_state: Arc<Mutex<SharedState>>,
} /// future와 대기하는 스레드가 공유할 상태 데이터
struct SharedState { /// 수면 시간이 경과했는지 여부 completed: bool, /// `TimerFuture`가 작동하는 task를 위한 waker /// 스레드는 `completed = true`를 설정한 후에 이를 사용하여 /// `TimerFuture`가 작동하는 task를 깨우고 `completed = true`를 확인해서 /// 다음 단계로 갈 수 있습니다. waker: Option<Waker>,
} 이제 실제 Future를 구현해봅시다. impl Future for TimerFuture { type Output = (); fn poll(self: Pin<&mut Self>, cx: &mut Context<'_>) -> Poll<Self::Output> { // 타이머가 완료되었는지를 확인하기 위해서 self.shared_state를 확인합니다. let mut shared_state = self.shared_state.lock().unwrap(); if shared_state.completed { // SharedState의 완료여부를 확인해서 완료이면 Poll::Ready(()) 반환 Poll::Ready(()) } else { // 완료가 아니면 waker를 설정해서 스레드가 타이머가 완료되었을 때 지금의 task를 깨우고 // future가 다시 poll해서 `completed = true`를 확인하도록 합니다. // // 매번 waker를 반복적으로 복제하는 것보다 한 번만 수행하는 것이 좋습니다. // 하지만 `TimeFuture`는 실행자의 task 간을 이동할 수 있어서 // 이로 인해 잘못된 task를 가리켜서 `TimeFuture`가 올바르게 깨어나는 것을 막는 // 부실한 waker가 생길 수 있습니다. // // 원래는 `Waker::will_wake` 함수를 사용해서 이를 확인할 수 있지만 // 여기서는 예시를 간단하게 유지하기 위해 생략합니다. shared_state.waker = Some(cx.waker().clone()); Poll::Pending } }
} 아주 간단하죠? 스레드가 shared_state.completed = true로 설정되어 있으면 완료된 것입니다! 그렇지 않으면 현재의 task에 대한 Waker를 복제해서 shared_state.waker에 넘겨줘서 스레드가 task 백업을 깨울 수 있게 하면 됩니다. 중요한 것은 future가 풀링될 때마다 Waker를 항상 업데이트해야 한다는 것입니다. 왜냐하면 future가 다른 task와 거기에 딸린 다른 Waker로 이동할 수 있기 때문입니다. 이런 일은 폴링된 후 task 사이에서 future가 전달될 때마다 일어납니다. 마지막으로 실제로 타이머를 구성하고 스레드를 시작할 API가 필요합니다. impl TimerFuture { /// 정해진 시간이 지나면 완료되는 새 `TimerFuture`를 만듭시다. pub fn new(duration: Duration) -> Self { let shared_state = Arc::new(Mutex::new(SharedState { completed: false, waker: None, })); // 새 스레드를 생성합시다. let thread_shared_state = shared_state.clone(); thread::spawn(move || { thread::sleep(duration); let mut shared_state = thread_shared_state.lock().unwrap(); // 타이머가 완료되었다는 것을 알리고 future가 폴링되는 마지막 task가 남아있으면 깨웁니다. shared_state.completed = true; if let Some(waker) = shared_state.waker.take() { waker.wake() } }); TimerFuture { shared_state } }
} 우와! 이것이 간단한 타이머 future를 만드는데 필요한 전부입니다. 이 future를 실행할 집행자가 있기만 하다면요.

